import React from "react";
import EpisodeComponent from "../../../components/EpisodePage.component";
import img9 from "../../../assets/NewCoverIMG/9.jpg";
import img8 from "../../../assets/NewCoverIMG/8.jpg"

export default function Episode9() {
  return (
    <EpisodeComponent
      episodeName='Pilot Episodes | Episode 9'
      host="justen"
      guest="Ania Anahata"
      guestLink="https://www.youtube.com/user/88anahata"
      spotifyLink="https://open.spotify.com/show/4b4Nokn6zf9wWcZkDikazp"
      youtubeLink="https://www.youtube.com/channel/UCXnT7Ih32dLtFhGAtYtsR2g/videos"
      applePodcastsLink="https://podcasts.apple.com/rs/podcast/stellar-sound-podcast/id1556200413"
      sponsor="fae-games"
      spotifyPlayerLink="https://www.youtube.com/embed/IJ9_4jpOSe8"
      description1='The fifth episode of the Stellar Pilot Series is dedicated to Ania Anahata.'
      description2='Emerging from Poland, talented Ania Anahata is a multi-instrumental and vocal artist. She is a violinist, violist, vocalist, music therapist, EFT coach and a meditation teacher.'
      description3='Ania is a big nature lover. Her goal is to share good energy with the world through her music. She creates ethno-inspired songs while doing the the vocal, violin, viola and electronic parts by herself.'
      description4='“I find inspiration in life, meditation, indigenous and ancient cultures, prayers, nature ... and I am stuffing this energy in songs so that you can sink into your heart and let it totally carry you”'
      guestsImagePath={img9}
      prevEpisode='Episode 8: Orlando Dees'
      prevEpisodePath="episode-8"
      prevEpisodeImgPath={img8}
      nextEpisodePath=""
      nextEpisodeImgPath=""
      nextEpisode='cooming siin'
    />
  );
}
